import { useState } from "react";
import SignIn from "../components/SignIn";
import SignUp from "../components/SignUp";

function Home({ token }) {
  const [isSignIn, setIsSignIn] = useState(true);
  return (
    <>
      {isSignIn ? (
        <SignIn setIsSignIn={setIsSignIn} />
      ) : (
        <SignUp setIsSignIn={setIsSignIn} />
      )}
    </>
  );
}

export default Home;
